  function drawBasic() {

      //var data = new google.visualization.DataTable();
      
      //console.log(dataTableArray);

      var data = google.visualization.arrayToDataTable(dataTableArray);

      var options = {
        title: 'Distance traveled by Picker',
        hAxis: {
          title: 'Order',
          //format: 'h:mm a',
          viewWindow: {
            //min: [7, 30, 0],
            //max: [17, 30, 0]
          }
        },
        vAxis: {
          title: 'Distance Traveled'
        }
      };

      var chart = new google.visualization.ColumnChart(
        document.getElementById('chart_div'));

      chart.draw(data, options);
    }

    function drawTotalDistanceChart() {

      //var data = new google.visualization.DataTable();
      
      
      console.log(totalDistanceArray);


      var data = google.visualization.arrayToDataTable(totalDistanceArray);

      var options = {
        title: 'Total Distance traveled by Picker',
        hAxis: {
          title: 'Order',
          //format: 'h:mm a',
          viewWindow: {
            //min: [7, 30, 0],
            //max: [17, 30, 0]
          }
        },
        vAxis: {
          title: 'Distance Traveled'
        }
      };

      var chart = new google.visualization.LineChart(
        document.getElementById('total_distance_chart_div'));

      chart.draw(data, options);
    }

    function drawHistoricTotalDistanceChart() {

      var totalHistoricDistanceArray = [['Order', 'Naruto', 'Existing']];

      var totalDistanceOld = 0;
      var totalDistanceNaruto = 0;
      //var data = new google.visualization.DataTable();
      historicDataArray.reverse();  // Old to new

      for (i=0; i<historicDataArray.length; ++i) {
        totalDistanceNaruto += historicDataArray[i][1];
        totalDistanceOld += historicDataArray[i][2];

        //console.log([historicDataArray[i][0],
        //  totalDistanceNaruto, totalDistanceOld
        //  ]);

        totalHistoricDistanceArray.push([i,  // historicDataArray[i][0]
          totalDistanceNaruto, totalDistanceOld
          ]);
      }
      

      document.getElementById("htotalDistanceExisting").innerHTML = totalDistanceOld;
          document.getElementById("htotalDistanceNaruto").innerHTML = totalDistanceNaruto;
          document.getElementById("hpercentage").innerHTML = Math.floor(100 - 100*totalDistanceNaruto / totalDistanceOld);

      var data = google.visualization.arrayToDataTable(totalHistoricDistanceArray);

      var options = {
        title: 'Last Week - Total Distance traveled by Picker',
        hAxis: {
          title: 'Order',
          //format: 'h:mm a',
          viewWindow: {
            //min: [7, 30, 0],
            //max: [17, 30, 0]
          }
        },
        vAxis: {
          title: 'Distance Traveled'
        }
      };

      var chart = new google.visualization.LineChart(
        document.getElementById('total_historic_distance_chart_div'));

      chart.draw(data, options);
    }



    var lastOrderId = 0;
      function initCharts() {
          //console.log("hello");
        //drawBasic();

        //drawTotalDistanceChart();

        drawHistoricTotalDistanceChart();

        loadNewOrder();

      } ;

      function loadNewOrder() {
        $.getJSON( "/v1/naruto/", function( data ) {
          console.log(data);
          var oid = data['order_id']
          if (oid == lastOrderId) {
            return; // Ignore
          }

          lastOrderId = oid;

          dataTableArray.push([oid, data['best_dist'], data['current_dist']]);

          drawBasic();

          totalDistanceExisting += data['current_dist'];
          totalDistanceNaruto += data['best_dist'];

          document.getElementById("totalDistanceExisting").innerHTML = totalDistanceExisting;
          document.getElementById("totalDistanceNaruto").innerHTML = totalDistanceNaruto;
          document.getElementById("percentage").innerHTML = Math.floor(100 - 100*totalDistanceNaruto / totalDistanceExisting);

          /*totalDistanceArray.push([oid,

          // console.log(totalDistanceSaving);

        });

        setTimeout(loadNewOrder, 10000);
      }
